import { find, propEq } from "ramda";


//TODO is it better to pass the meals as parameter here or to directly call it inside functi
export function getMealById(id, meals) {
  console.log(id);
  console.log(meals);
  const found = find(propEq("id", id))(meals);
  console.log(found);
}
